response.about:
*Слишком ДИКАЯ, чтобы жить и слишком РЕДКАЯ, чтобы умереть...*

Молодая и очень симпатичная особа ;)  Окончила Университет. Имею высшее образование, при чём очень глубоко имею ) В студенческие годы работала промоутером и консультантом. 8 лет отдала спортивным бальным танцам. Достигла В класса. Люблю волейбол, большой теннис. Хожу в спортзал. Обожаю Бильярд (пул). Есть в наличие водительские права и автомобиль. А в целом я очень жизнерадостный и позитивный челоФечек ;))

Я не рыжая – просто всегда во всем виноватая;
Я не голубоглазая – глаза у меня карие, и находятся они выше, чем Вы смотрите;
Я не маленькая – на коньках и в папахе я выше Вас;
Я не Венера – во мне нет ничего венерического ;
Я не красива – я чертовски мила;
Я не пьяница – просто могу много выпить;
Я не феминистка – я просто умнее;
Я Вас не умнее – просто Вы тупее;
Я не высокомерная – я брезгливая;
Я не стерва – я просто нетолерантна;
Я не знаю себе цену – я ни разу ее не называла;
Я не продажная – я просто не мелочусь;
Я не принцесса – но для некоторых просто подарок;
Я не трусиха – я просто знаю, что дело кончится жопой;
Я не разгильдяйка – я просто люблю поспать;
Я не неряха – мне просто мало места в шкафах;
У меня не дурной вкус в литературе – я просто читаю все;
Я не вру – я сочиняю;
Со мной не пропадешь – но горя хапнешь;
Не смотрите на меня ТАК – все бы ТАК на меня смотрели, была бы я королевой;
Я Вам не хамлю – я просто использую длинные слова;
Я Вас не перебиваю – просто у Вас регламент;
Я не пьяная – я задумчивая;
Я не серьезная – мне скучно;
Я не трезвая – я такая всегда;
Я не туплю – я не в настроении;
Я над Вами не издеваюсь – я Вас изучаю;
Я не использую дрянные аргументы – просто в моей коллекции дураков Вы не попали в десятку лучших;
Я Вас не игнорирую – просто Вы малозначимы;
Я всех не ненавижу – всех я люблю, но некоторых меньше;
Я не напыщенная дура – просто сегодня с самого утра не мой день...

"... Знаешь ли ты, о чём молчит она?
О чём её мечты?
Знаешь ли ты, что говорит она,
Когда не рядом ты?

(Рядом с кем-то другим...)

Знаешь ли ты, когда уйдет она
Куда она идёт? Слушая шаги...
Знаешь ли ты, имеешь ли ты власть,
Чтоб удержать её? ..." © Лепс
